import React, { Component } from "react";
import logo from "./logo.svg";
import "./App.css";
import * as ReactBootStrap from "react-bootstrap";
import Carousel from "react-bootstrap/Carousel";

// let img = document.querySelector("img");
// let box = document.getElementById("button");

// // if (box) {
// box.addEventListener("click", () => {
//   img.src = "https://i.imgur.com/21iJ3Qx.jpg";
//   console.log("test");
// });
// // }

class Nav extends Component {
  render() {
    return (
      <ReactBootStrap.Navbar
        collapseOnSelect
        expand="xl"
        bg="dark" // dark, primary, danger
        variant="dark"
      >
        <ReactBootStrap.Navbar.Brand href="#home">
          Harpreet Randhawa
          <img src={logo} className="App-logo" alt="logo" />
        </ReactBootStrap.Navbar.Brand>
        <ReactBootStrap.Navbar.Toggle aria-controls="responsive-navbar-nav" />
        <ReactBootStrap.Navbar.Collapse id="responsive-navbar-nav">
          <ReactBootStrap.Nav className="mr-auto" text-allign="center">
            <ReactBootStrap.Nav.Link href="#home">Home</ReactBootStrap.Nav.Link>
            <ReactBootStrap.Nav.Link href="#resume" className="resume">
              Resume
            </ReactBootStrap.Nav.Link>
            <ReactBootStrap.Nav.Link href="#aboutme">
              AboutMe
            </ReactBootStrap.Nav.Link>
            <ReactBootStrap.Nav.Link href="#comments">
              Comments
            </ReactBootStrap.Nav.Link>
            <ReactBootStrap.Nav.Link href="#contact">
              Contact
            </ReactBootStrap.Nav.Link>
            {/* <ReactBootStrap.NavDropdown
        title="Dropdown"
        id="collasible-nav-dropdown"
      >
        <ReactBootStrap.NavDropdown.Item href="#action/3.1">
          Action
        </ReactBootStrap.NavDropdown.Item>
        <ReactBootStrap.NavDropdown.Item href="#action/3.2">
          Another action
        </ReactBootStrap.NavDropdown.Item>
        <ReactBootStrap.NavDropdown.Item href="#action/3.3">
          Something
        </ReactBootStrap.NavDropdown.Item>
        <ReactBootStrap.NavDropdown.Divider />
        <ReactBootStrap.NavDropdown.Item href="#action/3.4">
          Separated link
        </ReactBootStrap.NavDropdown.Item>
      </ReactBootStrap.NavDropdown> */}
          </ReactBootStrap.Nav>
          <ReactBootStrap.Nav>
            {/* <ReactBootStrap.Nav.Link href="#deets">
        More deets
      </ReactBootStrap.Nav.Link>
      <ReactBootStrap.Nav.Link eventKey={2} href="#memes">
        Dank memes
      </ReactBootStrap.Nav.Link> */}
          </ReactBootStrap.Nav>
        </ReactBootStrap.Navbar.Collapse>
      </ReactBootStrap.Navbar>
    );
  }
}

class Header extends Component {
  render() {
    return (
      <header className="App-header">
        <div className="container5">
          <div id="box">
            <img src="https://i.imgur.com/JpeUHd0.jpg" alt="Me" id="cover" />
          </div>
        </div>
        <br></br>
        <h1 className="App-title"> Welcome to my website!</h1>
      </header>
    );
  }
}

const AboutMe = () => {
  return (
    <div className="App-header-aboutme">
      <p> About Me Here </p>
    </div>
  );
};

const Resume = () => {
  return (
    <div className="App-header-resume">
      {/* <img src="https://i.imgur.com/rtPObQD.jpg" alt="resume" /> */}
      <img
        src="https://i.imgur.com/FRkdFhb.jpg"
        alt="resume"
        className="resume"
      />
    </div>
  );
};

const Contact = () => {
  return (
    <div className="App-header-contact">
      <p> Contact here </p>
      <p>Email: Harpreetsrandhawa99@gmail.com</p>
      <p>LinkedIn: https://www.linkedin.com/in/harpreet-randhawa-965695159/</p>
      <p>Phone Number: 848-228-6014</p>
    </div>
  );
};

const Comments = () => {
  return (
    <div className="App-header-comments">
      <Carousel>
        <Carousel.Item>
          {/* <Carousel.Caption> */}
          <h3>First slide label</h3>
          <p>Nulla vitae elit libero, a pharetra augue mollis interdum.</p>
          {/* </Carousel.Caption> */}
        </Carousel.Item>
        <Carousel.Item>
          <Carousel.Caption>
            <h3>Second slide label</h3>
            <p>Lorem ipsum dolor sit amet, consectetur adipiscing elit.</p>
          </Carousel.Caption>
        </Carousel.Item>
        <Carousel.Item>
          <Carousel.Caption>
            <h3>Third slide label</h3>
            <p>
              Praesent commodo cursus magna, vel scelerisque nisl consectetur.
            </p>
          </Carousel.Caption>
        </Carousel.Item>
      </Carousel>
    </div>
  );
};

class App extends Component {
  render() {
    return (
      <div className="App">
        <Nav />
        <Header />
        <AboutMe />
        <Resume />
        <Comments />
        <Contact />
      </div>
    );
  }
}

export default App;
